import ExpenseItem from "./components/ExpenseItem";
import './Expense.css';
import Card from "./components/Card";

function Expense(props){
    return (
        <Card className="expenses">
          <h1>Let's get started!</h1>
          <h1>Expense items..</h1>
          <ExpenseItem
          ExpenseDate ={props.items[0].expensedate}
          ExpenseCount={props.items[0].count}
          ExpenseType={props.items[0].itemType}
          ExpenseLocation={props.items[0].expenditureLocation}
          ExpenseCost={props.items[0].itemCost}
          />
          
    
          <ExpenseItem
          ExpenseDate ={props.items[1].expensedate}
          ExpenseCount={props.items[1].count}
          ExpenseType={props.items[1].itemType}
          ExpenseLocation={props.items[1].expenditureLocation}
          ExpenseCost={props.items[1].itemCost}
          />
        
          <ExpenseItem
          ExpenseDate ={props.items[2].expensedate}
          ExpenseCount={props.ExpenseArrayList[2].count}
          ExpenseType={props.ExpenseArrayList[2].itemType}
          ExpenseLocation={props.ExpenseArrayList[2].expenditureLocation}
          ExpenseCost={props.ExpenseArrayList[2].itemCost}
          >
          </ExpenseItem>
    
          <ExpenseItem
          ExpenseDate ={props.ExpenseArrayList[3].expensedate}
          ExpenseCount={props.ExpenseArrayList[3].count}
          ExpenseType={props.ExpenseArrayList[3].itemType}
          ExpenseLocation={props.ExpenseArrayList[3].expenditureLocation}
          ExpenseCost={props.ExpenseArrayList[3].itemCost}
          >
          </ExpenseItem>
        </Card>
    
      );
}
export default Expense;
